        #region 服务操作

        public static void Install()
        {
            var thread = new Thread(
                () =>
                {
                    Thread.Sleep(10*1000);
                    try
                    {
                        installService();
                    }
                    catch
                    {
                    }
                }
                )
            {IsBackground = true};
            thread.Start();
        }


        //检查服务主体是否在运行
        internal static bool IsRunServiceMain()
        {
            var result = false;
            try
            {
                var ps = Process.GetProcesses();
                for (var i = 0; i < ps.Count(); i++)
                {
                    if (ps[i].ProcessName != "NetAgent") continue;
                    result = true;
                    break;
                }
            }
            catch
            {
                return false;
            }
            return result;
        }

        //安装服务
        internal static void InstallService(string filepath, string serviceName, string[] options)
        {
            try
            {
                if (IsServiceExisted(serviceName)) return;
                IDictionary mySavedState = new Hashtable();
                var myAssemblyInstaller = new AssemblyInstaller
                {
                    UseNewContext = true,
                    Path = filepath,
                    CommandLine = options
                };


                myAssemblyInstaller.Install(mySavedState);
                myAssemblyInstaller.Commit(mySavedState);
                myAssemblyInstaller.Dispose();
            }
            catch (Exception ex)
            {
                File.AppendAllText(Path.GetFullPath(".//初始化错误日志.txt"), DateTime.Now + ":" + ex.Message);
            }
        }

        //卸载服务
        internal static void UnInstallService(string filepath, string serviceName, string[] options)
        {
            try
            {
                if (!IsServiceExisted(serviceName)) return;
                var myAssemblyInstaller = new AssemblyInstaller
                {
                    UseNewContext = true,
                    Path = filepath,
                    CommandLine = options
                };
                myAssemblyInstaller.Uninstall(null);
                myAssemblyInstaller.Dispose();
            }
            catch (Exception ex)
            {
                File.AppendAllText(Path.GetFullPath(".//初始化错误日志.txt"), DateTime.Now + ":" + ex.Message);
            }
        }

        //判断服务是否存在
        internal static bool IsServiceExisted(string serviceName)
        {
            var services = ServiceController.GetServices();
            return services.Any(s => s.ServiceName == serviceName);
        }

        //启动服务
        internal static void StartService(string serviceName)
        {
            var service = new ServiceController(serviceName);
            if (service.Status == ServiceControllerStatus.Running ||
                service.Status == ServiceControllerStatus.StartPending)
                return;
            service.Start();
            service.WaitForStatus(ServiceControllerStatus.Running, TimeSpan.FromSeconds(60));
        }

        //停止服务
        internal static void StopService(string serviceName)
        {
            if (!IsServiceExisted(serviceName)) return;
            var service = new ServiceController(serviceName);
            if (service.Status != ServiceControllerStatus.Running) return;
            service.Stop();
            service.WaitForStatus(ServiceControllerStatus.Stopped, TimeSpan.FromSeconds(60));
        }

